@import url("https://fonts.googleapis.com/css2?family=Lato&display=swap");

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  font-family: "Lato", sans-serif;
}

/* Utility Classes */
.container {
  max-width: 1400px;
  margin: auto;
}

ul li {
  list-style: none;
}

nav {
  background-color: rgba(3, 37, 65);
  color: white;
  display: flex;
  justify-content: space-between;
  align-items: center;
  height: 9vh;
  padding: 0 80px;
}

nav ul {
  display: flex;
  align-items: center;
  justify-content: space-between;
  font-size: 22px;
}

nav ul .logo {
  background: url("/df0e416537c8bc1ccaf630b49175184f.svg")
    no-repeat center center/cover;
  height: 25px;
  width: 195px;
}

nav ul li {
  margin-right: 17px;
}

nav .icons-ul li i {
  font-size: 22px;
  margin-right: 20px;
}

/* Header section */
.background {
  background: url("/7717997d5f5909b45aac73a1924938b2.jpg") no-repeat center
    center/cover;
  display: flex;
  flex-direction: column;
  justify-content: center;
  padding: 0 80px;
  height: 40vh;
  color: white;
}

.background h1 {
  font-size: 50px;
}

.background h2 {
  font-size: 30px;
  margin: 10px 0;
}

.background form {
  width: 100%;
  position: relative;
  margin-top: 40px;
}
.background input {
  width: 100%;
  padding: 16px 50px;
  border-radius: 50px;
  border: none;
  outline: none;
}

.background input::placeholder {
  font-size: 18px;
}

.background button {
  position: absolute;
  right: 0;
  top: 0;
  height: 100%;
  width: 120px;
  border-radius: 50px;
  border: none;
  outline: none;
  cursor: pointer;
  background: linear-gradient(
    to right,
    rgba(30, 213, 169, 1) 0%,
    rgba(1, 180, 228, 1) 100%
  );
}

/* popular section */
.popular,.latest ,.freetowatch{
  padding: 30px;
}

.popular .popular-heading , .latest .latest-heading ,.freetowatch .freetowatch-heading {
  display: flex;
  align-items: center;
  margin-bottom: 30px;
}

.popular .popular-heading h4 ,.latest .latest-heading  h4,.freetowatch .freetowatch-heading h4{
  font-size: 24px;
  margin-right: 30px;
}

.popular .popular-heading .categories {
  border: 1px solid black;
  display: flex;
  width: 500px;
  height: 30px;
  align-items: center;
  border-radius: 50px;
}

.popular .popular-heading .categories span {
  display: inline-block;
  width: 25%;
  height: 100%;
  text-align: center;
  cursor: pointer;
  padding-top: 3px;
  color: black;
  font-weight: 600;
}

.popular .popular-heading .categories span.active  {
  background-color: #00003d;
  border-radius: 50px;
  color: white;
