  height: 300px;
  border-radius: 10px;
}
.movie-title {
  margin: 15px 0px;
  font-size: 21px;
}
.popular .movie-card h6 {
  font-size: 17px;
  margin-bottom: 7px;
  color: grey;
}
.movie-rating {
  height: 50px;
  width: 50px;
  border-radius: 50%;
  background-color: rgba(3, 37, 65);
